import React from 'react';
import './VendorCard.css';

const VendorCard = ({ vendor, onClick }) => {
  const {
    name,
    image,
    rating,
    totalRatings,
    distance,
    isOpen,
    speciality,
    productIds
  } = vendor;

  return (
    <div className="vendor-card" onClick={onClick}>
      <div className="vendor-header">
        <div className="vendor-image">
          <span className="vendor-emoji">{image}</span>
        </div>
        <span className={`status-badge ${isOpen ? 'open' : 'closed'}`}>
          {isOpen ? '‚óè Open' : '‚óè Closed'}
        </span>
      </div>

      <div className="vendor-body">
        <h3 className="vendor-name">{name}</h3>
        
        <div className="vendor-details">
          <div className="vendor-rating">
            <span className="rating-star">‚≠ê</span>
            <span className="rating-value">{rating}</span>
            <span className="rating-count">({totalRatings})</span>
          </div>
          <span className="vendor-distance">üìç {distance}</span>
        </div>

        <div className="vendor-footer">
          <span className="speciality-tag">{speciality}</span>
          <span className="items-count">{productIds.length} items</span>
        </div>
      </div>
    </div>
  );
};

export default VendorCard;
